  <style>
    * {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
      line-height: 161.19% !important;
    }

    ul {
      list-style-type: none
    }

    img {
      max-width: 100%
    }

    body {
      font-family: Roboto, Helvetica Neue, -apple-system, Arial, sans-serif;
      font-size: 13px;
      background: #000;
      color: #fff;
      max-width: 600px;
      margin: 0 auto
    }

    .header {
      width: 750px;
      max-width: 100%;
      margin: 0 auto
    }

    .header__wrapper {
      height: 50px;
      display: flex;
      align-items: center;
      justify-content: space-between;
      padding: 0 5px
    }

    .header__logo {
      width: 180px
    }

    .header__controls {
      display: flex;
      align-items: center;
      gap: 24px
    }

    .header__menu {
      background: #212125;
      height: 32px;
      display: flex;
      align-items: center;
      justify-content: center;
      gap: 10px;
      font-weight: 700;
      font-size: 14px
    }

    .header__menu-icon {
      display: flex;
      flex-direction: column;
      width: 16px;
      gap: 3px
    }

    .header__menu-icon span {
      width: 100%;
      height: 2px;
      background: #fff
    }

    .header__tags {
      padding: 14px 4px
    }

    .header__tags-wrapper {
      margin-bottom: 14px;
      display: flex;
      flex-wrap: wrap;
      justify-content: center;
      align-items: center;
      gap: 6px
    }

    .header__tags-wrapper:last-child {
      margin-bottom: 0
    }

    .header__tags-item {
      display: flex;
      align-items: center;
      justify-content: center;
      gap: 5px;
      font-weight: 700;
      border: 1px #292828 solid;
      border-radius: 4px;
      padding: 5px 7px 5px 6px
    }

    .header__tags-item.item--red {
      color: #fff;
      background: #de3151
    }

    .main__item {
      margin-bottom: 10px
    }

    .main__item:last-child {
      margin-bottom: 0
    }

    .main__item .item__image {
      width: 100%;
      display: flex;
      align-items: center;
      justify-content: center
    }

    .main__item .item__image .image {
      width: 100%
    }

    .main__item .item__content {
      background: #101010;
      border: 1px solid #292828;
      color: #e8e8e8;
      padding: 5px 4px
    }

    .main__item .item__title {
      text-align: center;
      margin-bottom: 18px;
      font-weight: 600
    }

    .main__item .item__info-wrapper {
      display: flex;
      align-items: center;
      justify-content: space-around;
      color: #acb6be
    }

    .main__item .item__info-wrapper [class^=item__] {
      display: flex;
      align-items: center;
      gap: 5px
    }
  </style>
</head>
